import React from 'react';
import styled  from 'styled-components';
import Burger from './Burger';
import Link from 'next/link';





const Nav = styled.nav`
  width: 100%;
  height: 55px;
  padding: 0 20px;
  display: flex;
  justify-content: space-between;
  color: white;
  
  width: 100%;
  height: 600px;
  /* background: linear-gradient(to right, rgba(31, 177, 57, 0.46), rgba(11, 215, 128, 0.66)); */
 




  .logo {
    padding: 15px 0;
    width: 80px;
    height: 80px;
  }
`

const Navbar = () => {
  return (
    <Nav>
      
        <div className="logo">
          <Link href="/" passHref><p>Logo</p></Link>
        </div>
        <img src="./img/home-wide.jpg" alt="imagen"></img>       
      <Burger />
      
    </Nav>
  )
}

export default Navbar
